import React from 'react';
import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  // React.useEffect(() => {

  //   fetch("https://api.truyenfull.vn/v1/tim-kiem")
  //     .then((res) => res.json())
  //     .then((data) => setData(data.data));

  // },[])
  fetch('/search')
    .then(response => response.json())
    .then(data => {
        // Xử lý dữ liệu trả về từ backend và hiển thị nó lên giao diện
        console.log(data);
    })
    .catch(error => {
        console.error('Error fetching data:', error);
    });

  return (
        <p>{!data ? "Loading..." : data}</p>
  );
}

export default App;
